import React, { Component } from 'react';

class Concert extends Component {

  render() {
    return (
      <div className="card">
        <h2>{this.props.artist.name}</h2>
        <img src={this.props.artist.image} alt={this.props.toy.name} className="toy-avatar" />
        <p>Genre: {this.props.artist.genre}</p>
      </div>
    );
  }

}

export default Concert;
